import React, { Component } from "react";

class ListEmployee extends Component {
  constructor(props) {
    super(props);
    this.state = {
      employee: []
    };
  }
  render() {
    return (
      <div>
        <h1 className="text-center">List Employees</h1>
        <div className="row"></div>
        <table className="table table-striped table-bordered"></table>
        <thead>
          <tr>Employee Id</tr>
          <tr>Employee LastName</tr>
          <tr>Employee FirstName</tr>
          <tr>Employee email</tr>
          <tr>Actions</tr>
        </thead>
        <tbody>
          {this.state.employee.map(employee => (
            <tr key={employee.id}>
              <td> {employee.firstName}</td>
              <td> {employee.LasttName}</td>
              <td> {employee.email}</td>
            </tr>
          ))}
        </tbody>
      </div>
    );
  }
}

export default ListEmployee;
